import React from 'react';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import {timesCircle} from 'react-icons-kit/fa/timesCircle';
import Icon from 'react-icons-kit';

class AlertDialog extends React.Component {
  constructor(props){
      super(props);
      this.state = {
        open: false,
      };
    }


  handleClickOpen  ()  {
    this.setState({ open: true });
  };

  handleClose  ()  {
    this.setState({ open: false });
  };

  handleAccept  ()  {
    this.setState({ open: false });
  };

  render() {
    return (
      <div>
        <Button onClick={this.handleClickOpen} style={{fontFamily:"gotham_htfbook"}}><Icon icon={timesCircle}/>Deny</Button>
        <Dialog
          open={this.state.open}
          onClose={this.handleClose}
          aria-labelledby="alert-dialog-title"
          aria-describedby="alert-dialog-description"
        >
          <DialogContent>
            <DialogContentText id="alert-dialog-description" style={{fontFamily:"gotham_htfbook"}}>
              Are you sure you wish to deny this pull request?
            </DialogContentText>
          </DialogContent>
          <DialogActions>
            <Button onClick={this.handleAccept} color="primary" style={{fontFamily:"gotham_htfbook"}}>
              Deny
            </Button>
            <Button onClick={this.handleClose} color="primary" autoFocus style={{fontFamily:"gotham_htfbook"}}>
              Cancel
            </Button>
          </DialogActions>
        </Dialog>
      </div>
    );
  }
}

export default AlertDialog;
